import React, { useEffect, useState } from "react";
import { FaTimes } from "react-icons/fa";

const FlightTypeForm = ({ existingData = {}, onSubmit }) => {
  const [form, setForm] = useState({
    name: "",
    capacity: "",
    description: "",
    maxSpeed: "",
    status: "Active",
    images: [],
  });

  const [previewImages, setPreviewImages] = useState([]); // For newly selected images
  const [existingImages, setExistingImages] = useState([]); // For existing images (from DB)
  const [removedImages, setRemovedImages] = useState([]); // public_ids of removed existing images

  useEffect(() => {
    if (existingData && existingData._id) {
      setForm({
        name: existingData.name || "",
        capacity: existingData.capacity || "",
        description: existingData.description || "",
        maxSpeed: existingData.maxSpeed || "",
        status: existingData.status || "Active",
        images: [],
      });
      setExistingImages(existingData.images || []);
    }
  }, [existingData]);

  const handleChange = (e) => {
    const { name, value, type, files } = e.target;

    if (type === "file") {
      const selectedFiles = Array.from(files);
      setForm({ ...form, images: selectedFiles });
      setPreviewImages(selectedFiles.map((file) => URL.createObjectURL(file)));
    } else {
      setForm({ ...form, [name]: value });
    }
  };

  const removeExistingImage = (public_id) => {
    setRemovedImages([...removedImages, public_id]);
    setExistingImages(
      existingImages.filter((img) => img.public_id !== public_id)
    );
  };

  const removeNewImage = (index) => {
    const updatedImages = [...form.images];
    const updatedPreviews = [...previewImages];
    updatedImages.splice(index, 1);
    updatedPreviews.splice(index, 1);
    setForm({ ...form, images: updatedImages });
    setPreviewImages(updatedPreviews);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const payload = new FormData();
    payload.append("name", form.name);
    payload.append("capacity", form.capacity);
    payload.append("description", form.description);
    payload.append("maxSpeed", form.maxSpeed);
    payload.append("status", form.status);

    form.images.forEach((file) => {
      payload.append("images", file);
    });

    payload.append("removedImages", JSON.stringify(removedImages));

    onSubmit(payload); // Call parent-provided submit handler
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* Example form fields */}
      <div className="mb-3">
        <input
          type="text"
          name="name"
          value={form.name}
          onChange={handleChange}
          placeholder="Name"
          className="form-control"
          required
        />
      </div>

      <div className="mb-3">
        <input
          type="number"
          name="capacity"
          value={form.capacity}
          onChange={handleChange}
          placeholder="Capacity"
          className="form-control"
          required
        />
      </div>

      {/* Add other fields like description, maxSpeed, status similarly */}

      {/* File Upload */}
      <div className="mb-3">
        <input
          type="file"
          name="images"
          className="form-control"
          accept="image/*"
          onChange={handleChange}
          multiple
        />
      </div>

      {/* Existing Images (from DB) */}
      <div className="row">
        {existingImages.map((img, idx) => (
          <div className="col-md-2 mb-3 position-relative" key={idx}>
            <img
              src={img.url}
              alt={`Existing ${idx}`}
              className="img-fluid rounded"
            />
            <FaTimes
              onClick={() => removeExistingImage(img.public_id)}
              className="position-absolute top-0 end-0 text-danger bg-white p-1 rounded-circle"
              style={{ cursor: "pointer" }}
            />
          </div>
        ))}
      </div>

      {/* New Image Previews */}
      <div className="row">
        {previewImages.map((src, idx) => (
          <div className="col-md-2 mb-3 position-relative" key={idx}>
            <img
              src={src}
              alt={`Preview ${idx}`}
              className="img-fluid rounded"
            />
            <FaTimes
              onClick={() => removeNewImage(idx)}
              className="position-absolute top-0 end-0 text-danger bg-white p-1 rounded-circle"
              style={{ cursor: "pointer" }}
            />
          </div>
        ))}
      </div>

      <button type="submit" className="btn btn-primary">
        Submit
      </button>
    </form>
  );
};

export default FlightTypeForm;
